export function changeSportId(newID){
    return {type: "CHANGE_SPORT_ID", payload: {currentSportId: newID}}
}

export function changeViewStatus(newTeam){
    return {type: "CHANGE_GROUP_VIEWING_STATUS", payload: {myTeam: newTeam}}
}
